    {
      "cell_type": "markdown",
      "source": [
        "* **trestbps (pressão arterial em repouso) vs Idade:**\n",
        "  Não parecer haver uma forte correlação entre idade e a pressão arterial em repouso, apesar de valores mais altos estarem presentes nas idades mais avançadas.\n",
        "\n",
        "* **chol (colesterol sérico) vs Idade:**\n",
        "  Existe uma leve concentração de valores de colsteroal ao redor de 200 a 300 mg/dL pra todas as idades. No entanto, há poucos indivíduos mais jovens (abaixo de 50 anos) com níveis muito elevados de colesterol. Podemos tirar de conclusão que o colesterol elevado não é exclusivo de idades mais avançadas, mas é mais comum em pessoas acima dos 40-50 anos.\n",
        "\n",
        "* **thalach (frequência cardíaca máxima alcançada) vs Idade:**\n",
        "  Aqui, podemos observar uma correlação negativa. À medida que a idade aumenta, a frequência cardíaca máxima alcançada tende a diminuir. Isso de fato faz sentido do ponto de visto fisiológico, pois a capacidade cardiovascular tem essa tendência de diminuir com a idade\n",
        "\n",
        "* **oldpeak (depressão do segmento ST induzida pelo exercício em relação ao repouso) vs Idade:**\n",
        "  Não parece haver uma correlação clara entre idade e o valor de oldpeak. Os valores estão bem dispersos ao longo da idade."
      ],
      "metadata": {
        "id": "fbUrj--a3VFx"
      }
    },
