        "* **trestbps (pressão arterial em repouso) vs Sexo:**\n",
        "  Como podemos notar, os boxplots para homens e mulheres são muito semelhantes. Ambos os gêneros têm uma distribuição concetrada entre 120 e 140. Logo, é possível perceber que o sexo não parece influenciar a pressão arterial em repouso\n",
        "\n",
        "* **chol (colesterol sérico) vs Sexo:**\n",
        "  Observa-se uma leve tendência de que o colesteroal das mulheres seja um pouco mais elevado. O intervalo interquartil (IQR) para as mulheres também á maior, sugerindo maior variabilidade nos níveis de colesterol\n",
        "\n",
        "* **thalach (frequência cardíaca máxima alcançada) vs Sexo:**\n",
        "  Os homens apresentam maior dispersão nos valores de thalach, com alguns valores mínimos menores que os das mulheres. Isso indica que, em termos de frequência cardíaca máxima, os homens têm uma variação maior.\n",
        "\n",
        "* **oldpeak (depressão do segmento ST induzida pelo exercício em relação ao repouso) vs Sexo:**\n",
        "  ara oldpeak, os valores entre os sexos são comparáveis, mas os homens apresentam valores mais dispersos com alguns outliers mais altos. Pode-se obsrvar que a diferença entre os gêneros não é significativa"
