        "## Insights e Conclusões\n",
        "\n",
        "### Análises Unidimensionais:\n",
        "- **Sexo:** Homens são ligeiramente mais propensos a desenvolver doenças cardíacas.\n",
        "- **Pressão Arterial (trestbps):** Não há diferenças significativas entre saudáveis e doentes, sugerindo que não é um bom indicador isolado.\n",
        "- **Colesterol (chol):** Pacientes doentes têm níveis medianos ligeiramente mais baixos, embora alguns apresentem colesterol elevado.\n",
        "Frequência Cardíaca Máxima (thalach): Pacientes saudáveis tendem a atingir frequências cardíacas mais altas.\n",
        "- **Depressão ST (oldpeak):** Pacientes doentes tendem a ter valores de depressão ST mais baixos.\n",
        "\n",
        "### Análises Bidimensionais (Correlação):\n",
        "- **Dor no Peito (cp):** Fortemente correlacionada com a presença de doença, especialmente em casos de angina típica\n",
        "- **Frequência Cardíaca Máxima (thalach):** Quanto maior, mais saudável o paciente.\n",
        "- **Depressão ST (oldpeak) e Angina por Exercício (exang):** Fortes preditores de risco cardíaco.\n",
        "- **Número de Vasos (ca):** Menor número de vasos coloridos está associado a um maior risco de doença.\n",
        "\n",
        "### Insights Multivariados\n",
        "- Pressão Arterial e Colesterol: Isoladamente não são bons preditores, mas suas interações com outras variáveis podem fornecer insights mais precisos.\n",
        "- Variáveis de Esforço (exang e thalach): A capacidade cardíaca durante o esforço é crítica para prever a doença.\n",
        "- Vasos Coloridos (ca) e Depressão ST: São indicadores importantes da gravidade da doença e complicações cardiovasculares."
